package com.enterprise.web.util;

import java.io.File;
import java.io.InputStream;
import java.util.ArrayList;

import javax.xml.parsers.DocumentBuilder;
import javax.xml.parsers.DocumentBuilderFactory;

import org.w3c.dom.Document;
import org.w3c.dom.Node;
import org.w3c.dom.NodeList;

public class ProcessXml {
	
	public static ArrayList<String> valueList = new ArrayList<String>();
	private static StringBuilder hearderStrBldr = new StringBuilder();
	private static StringBuilder valueStrBldr = new StringBuilder();

	public static void main(String[] args) {
		try {
			System.out.println("----------"+"aaabcd,".replaceFirst(".$",""));
			//String ss = "";
			//System.out.println("----------"+ss);
			File file = new File("W:\\222.xml");
			DocumentBuilder dBuilder = DocumentBuilderFactory.newInstance()
			.newDocumentBuilder();
			Document doc = dBuilder.parse(file);
			System.out.println("Root element :" + doc.getDocumentElement().getNodeName());
			if (doc.hasChildNodes()) {
				printNote(doc.getChildNodes());
			}
			System.out.println("##########"+valueList);
			System.out.println("##########"+valueList.size());
		} catch (Exception e) {
			System.out.println(e.getMessage());
		}
	}
	
	public static String processXml(InputStream inputStream) {
		String returnString = "";
		try {
			DocumentBuilder dBuilder = DocumentBuilderFactory.newInstance()
			.newDocumentBuilder();
			Document doc = dBuilder.parse(inputStream);
			if (doc.hasChildNodes()) {
				printNote(doc.getChildNodes());
			}
			returnString = hearderStrBldr.toString().replaceFirst(".$","") +System.lineSeparator()+ valueStrBldr.toString().replaceFirst(".$","");
		} catch (Exception e) {
			System.out.println(e.getMessage());
		}
		return returnString;
	}

	private static void printNote(NodeList nodeList) {
		for (int count = 0; count < nodeList.getLength(); count++) {
			Node tempNode = nodeList.item(count);
			if (tempNode.getNodeType() == Node.ELEMENT_NODE) {
				if (tempNode.hasChildNodes()) {
					printNote(tempNode.getChildNodes());
				}
			}
			else {
				hearderStrBldr.append(tempNode.getParentNode().getParentNode().getNodeName()+" "+tempNode.getParentNode().getNodeName()+",");
				valueStrBldr.append(tempNode.getTextContent()+",");
			}
		}
	}
}
